import { useEffect } from "react";
import Cloud from "../Cloud/cloud";
import Classes from "./card.module.css";

const Card = (props) => {
  return (
    <div className={`${Classes.Card} ${props.class}`}>
      <h1>So what is the weather in {props.name}</h1>
      <div className={Classes.temperature}>{props.temperature}&#8451;</div>
    </div>
  );
};

export default Card;

Card.defaultProps = {
  city: "Tel Aviv",
  temperature: "30",
};

